import headshot from "./profil.jpg";

function App() {
  return (
    <div>
      <div className="nav-top">
        <h2 className="playfair-display">Filip von Knorring</h2>
      </div>
      <div class="content">
        <header className="header playfair-display">
          <h1>Filip</h1>
          <h1 className="h1-sub">von Knorring</h1>
        </header>
      </div>
    </div>
  );
}

export default App;
